import React, { useEffect } from 'react';

function Error(props){

  useEffect(() => {
    props.setShowFooter(true);
    document.title = "SHAREHOME - Something went wrong!";
  });

  return (
    <div className="content max-width">
      <h1 className="title noselect"> </h1>
      <div>
        <h1 className="subtitle">Woops, something went wrong!</h1>
        <p>You tried to go to a page that doesn't exist! Click <a href="/">here to go back home.</a></p>
      </div>
    </div>
  )
}

export default Error;
